import React, { Component } from 'react';

class HeaderName extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div style={{color:'black', marginLeft:"10vh", marginTop:"2vh"}}>
                <h1>Zero Zhang</h1>
                <h3>Production Designer at AFI</h3>
            </div>
        );
    }
};

export default HeaderName;
